  false,\n\t\"url\": null,\n\t\"notes\": \"This layer shows only non-attaining segments
  of the Integrated List. The Streams Integrated List represents stream assessments
  in an integrated format for the Clean Water Act Section 305(b) reporting and Section
  303(d) listing. Streams are bodies of flowing surface water that collectively form
  a network that drains a catchment or basin. PA DEP protects 4 stream water uses:
  aquatic life, fish consumption, potable water supply, and recreation. The 305(b)
  layers represents stream segments that have been evaluated for attainment of those
  uses. If a stream segment is not attaining any one of its 4 uses, it is considered
  impaired. u8def Aquatic Life use attainment - The integrity reflected in any component
  of the biological community. (i.e. fish or fish food organisms) u8def Fish Consumption
  use attainment - The risk posed to people by the consumption of aquatic organisms
  (ex. fish, shellfish, frogs, turtles, crayfish, etc.) u8def Recreational use attainment
  - The risk associated with human recreation activities in or on a water body. (i.e.
  exposure to bacteria and other disease causing organisms through water contact recreation
  like swimming or water skiing) u8def Potable Water Supply use attainment - The risk
  posed to people by the ingestion of drinking water Segments that have appeared on
  an approved Category 5 Integrated Listing are the entries labeled as approved. Integrated
  Lists are submitted for approval every other year. Segments entered subsequent to
  the latest approved Category 5 listing are labeled tentative. After appearing on
  an approved listing, the tentative entries move to approved. The Stream Integrated
  List is provided as two separate layers determined if the stream is attaining or
  not attaining its designated uses. DEP Streams Integrated List layer is maintained
  by the PADEP Office of Water Management, Bureau of Water Supply & Wastewater Management,
  Water Quality Assessment and Standards Division. The layer is based on the High
  Resolution National Hydrography Dataset (NHD). Additional update information is
  provided by Bureau of Watershed Management, Water Use Planning Division.\",\n\t\"owner_org\":
